#![allow(dead_code, unused_imports)]
use proconio::input;
use itertools::Itertools;
use std::cmp::{max, min};
use std::cmp::Ordering;
use std::collections::VecDeque;
use std::collections::BinaryHeap;
use std::collections::HashMap;
use std::collections::BTreeMap;
use std::ops::Bound::{Excluded, Included, Unbounded};
use std::collections::{HashSet, BTreeSet};
use proconio::marker::Chars;
use std::f64::consts::PI;
use std::mem::swap;
use superslice::*;
fn main() {
    // 2024-09-07 12:57-13:21 (24min, first submit)
    // 2024-09-07 13:21-15:09 (108min, debug)
    // Total: 132 min
    input! {
        s: Chars,
        x0: isize,
        y0: isize,
    }

    // let DP_SIZE = 8;
    // let OFFSET = 4;

    let OFFSET: usize = 8000;
    let DP_SIZE: usize = 16_010;

    let xs: usize = OFFSET;
    let ys: usize = OFFSET;

    let xt: usize = (x0 + OFFSET as isize) as usize;
    let yt: usize = (y0 + OFFSET as isize) as usize;

    let mut dp_x: Vec<bool> = vec![false; DP_SIZE];
    let mut dp_y: Vec<bool> = vec![false; DP_SIZE];

    dp_x[xs] = true;
    dp_y[ys] = true;

    let mut x = xs;
    let mut is_first = true;
    let mut is_x_dir = true;
    let mut count = 0;
    for i in 0..s.len() {
        if is_first {
            if s[i] == 'F' {
                dp_x[x+1] = true;
                dp_x[x] = false;
                x = x + 1;
            }
            else {
                is_first = false;
                is_x_dir = false;
            }
            continue
        }
        if s[i] == 'F' {
            count += 1;
            continue
        }

        let mut pre_dp = vec![false; DP_SIZE];
        if is_x_dir {
            swap(&mut pre_dp, &mut dp_x);
            for pos in 0..16_001 {
                if pre_dp[pos] {
                    dp_x[pos+count] = true;
                    if pos >= count {
                        dp_x[pos-count] = true;
                    }
                }
            }
        }
        else {
            swap(&mut pre_dp, &mut dp_y);
            for pos in 0..16_001 {
                if pre_dp[pos] {
                    dp_y[pos+count] = true;
                    if pos >= count {
                        dp_y[pos-count] = true;
                    }
                }
            }
        }
        is_x_dir = !is_x_dir;
        count = 0;

    }

    if count > 0 {
        let mut pre_dp = vec![false; DP_SIZE];
        if is_x_dir {
            swap(&mut pre_dp, &mut dp_x);
            for pos in 0..16_001 {
                if pre_dp[pos] {
                    dp_x[pos+count] = true;
                    if pos >= count {
                        dp_x[pos-count] = true;
                    }
                }
            }
        }
        else {
            swap(&mut pre_dp, &mut dp_y);
            for pos in 0..16_001 {
                if pre_dp[pos] {
                    dp_y[pos+count] = true;
                    if pos >= count {
                        dp_y[pos-count] = true;
                    }
                }
            }
        }
    }

    if dp_x[xt] && dp_y[yt] {
        println!("Yes");
    }
    else {
        println!("No");
    }

}

